import Button from "../../components/buttons";
import { useNavigate } from "react-router-dom";
import background from '../../assets/background.jpg';
import background1 from '../../assets/background.jpg';
import { useState } from "react";

function Home() {
  const navigate = useNavigate();

  const onClickButton = (url) => {
    navigate(url);
  };

  return (
    <section className="hero is-medium is-fullheight" style={{backgroundImage:`url(${background})`, backgroundSize:"cover"}}>;
      <div className="hero-body">
        <div className="container has-text-centered">
          <Button
            onClick={() => onClickButton("/game")}
            text="Haz click para iniciar el juego"
          />
        </div>
      </div>
    </section>
  );
}

export default Home;
